@Component({
  selector: 'my-first-c',
  templateUrl: './my-first-c.component.html',
  styleUrls: ['./my-first-c.component.css']
})
export class MyFirstCComponent {

}
<div> id
   <p>Third Component, that will be exported by using the third module!</p>
   <div>
      <p>my-first3 contains 2 other folders:</p>
      <ul>
         <li>my-first3-m (that contains a module to exporting this component content to application on browser module)</li>
         <li>my-first-c (that contains the component files)</li>
      </ul>
   </div>
</div>
